import logo from '/src/images/tea.png';
function Navbar() {
    return (
        <header>
            <nav>
                <div id="logo_div">
                    <img src={logo}></img>
                </div>
                <div id="link_div"> 
                    <a href="#"class="active">Home</a>				
                    <a href="#">Blog</a>
                    <a href="#">Contact</a>
                </div>
            </nav>
        </header>
  );
}

export default Navbar;
